import { AppBar, Box, Container, Toolbar, Typography } from "@mui/material";
import React from "react";

export const Footer = () => {
    return (
         <AppBar sx={{
                  display: 'flex',
                  minHeight: '10%',
                  m: 0, p: 0, 
                  pl: 'auto',
         }} position="static">
      <Container sx={{ m: 0, p: 0 }} maxWidth="xl" >
        <Toolbar sx={{ m: 0, p: 0 }}>
            <Typography   variant="h5"> fggggg</Typography>
            <Typography   variant="h5"> </Typography>
            <Typography   variant="h5"> fggggg</Typography>
            <Typography   variant="h5"> </Typography>
            <Typography   variant="h5"> fggggg</Typography>

            <Typography   variant="h5"> </Typography>
            <Typography   variant="h5"> fggggg</Typography>

            <Typography   variant="h5"> \n'</Typography>
            <Typography   variant="h5"> fggggg</Typography>






        </Toolbar>
      </Container>
    </AppBar>
    );
};

export default Footer;
